import './Products.css'
import { ItemCard } from '../ItemCard/ItemCard'

export const Products = ( { products, /*paginaProduto*/} ) =>{

    const paginaProduto = (e) =>{
        products.map( (product) =>{
            console.log(product)
        })
    }

    return(
        <div className='Products' onClick={paginaProduto}>
            {products.map( product => (
                <ItemCard
                    key={product.id}
                    category={product.category} 
                    id={product.id}
                    thumbnail={product.thumbnail}
                    title={product.title}
                    brand={product.brand}
                    price={product.price}
                    rating={product.rating}   
                />
            ))}
        </div>
    )
}
